export default function App() {
  return (
    <div className="App">
      <Header
        pfp=""
        name="Rodríguez López, Alejandro"
        info={[
          {
            k: "Born in",
            v: "2002",
          },
          {
            k: "Tlf.",
            v: "+34 660 51 01 99",
          },
          {
            k: "email",
            v: "alejandro.rod.lop@gmail.com",
          },
          {
            k: "Location.",
            v: "33204, Gijón, Asturias, Spain",
