        ]}
      />
      <hr/>
      <Collapsible
        title="Previous Experience"
        children={[
          <PreviousExperienceSet
            experiences={[
              {
                title: "IT System Configurator",
                dateRange: {
                  from: "May 2021",
                  to: "Sep 2022",
                },
                content: "fuck",
              }, {
                title: "Private Tutor",
                dateRange: {
                  from: "May 2020",
                  to: "Sep 2022",
                },
                content: "fuck",
              }
            ]}
          />,
        ]}
      />
      <hr/>
    </div>
  );
}
